import React from  "react";


export default function Forecast(props){


    let src1 = `http://openweathermap.org/img/wn/${props.forecast[0].emoji}@2x.png`
    let src2 = `http://openweathermap.org/img/wn/${props.forecast[1].emoji}@2x.png`
    let src3 = `http://openweathermap.org/img/wn/${props.forecast[2].emoji}@2x.png`
    let src4 = `http://openweathermap.org/img/wn/${props.forecast[3].emoji}@2x.png`
    let src5 = `http://openweathermap.org/img/wn/${props.forecast[4].emoji}@2x.png`


    let [date ,setDate] = useState(null);
    let[day , setDay ] = useState(null);

    let days = [
        "Mon",
        "Tue",
        "Wed",
        "Thurs",
        "Fri",
        "Sat",
        "Sun",
      ];

      let forecatsdays = [day, day, day , day, day]


      window.onload = function() {
        getDays();
      }


    function getDays(){
        let day = loadDate();
        let index = days.indexOf(day)


        forcastdays.map((day) => {
          if (index === 6){
            index = 0;
            let day = days[index];

          }else{
            index = index+1
            setDay(days[index]);
          }
        });


      }

      function loadDate() {
        let now = new Date();
        let day = days[now.getDay()];
        let hours = now.getHours();
        let min = now.getMinutes();
        if (min < 10) {
          min = `0${min}`;
        }
        let time = `${hours}:${min}`;

        setDate  (time);

        return(day);
      }

    return(
    <div className="Forecast">
        <div className="row">
            <div className="col-sm-2">
                <div className="day">{props.forecast[0].date}</div>
                <img src={src1} alt="" className="weathericon"></img>
                <div className="dayTemp"> <span>{Math.round(props.forecast[0].temp)}</span>˚</div> 
            </div>
            <div className="col-sm-2">
                <div className="day">{props.forecast[1].date}</div>
                <img src={src2} alt="" className="weathericon"></img> 
                <div className="dayTemp"> <span>{Math.round(props.forecast[1].temp)}</span>˚</div>

            </div>
            <div className="col-sm-2">
                <div className="day">{props.forecast[2].date}</div>
                <img src={src3} alt="" className="weathericon"></img> 
                <div className="dayTemp"> <span>{Math.round(props.forecast[2].temp)}</span>˚</div>

            </div>
            <div className="col-sm-2">
                 <div className="day">{props.forecast[3].date}</div>
                 <img src={src4} alt="" className="weathericon"></img>
                <div className="dayTemp"> <span>{Math.round(props.forecast[3].temp)}</span>˚</div> 

            </div>
            <div className="col-sm-2">
                <div className="day">{props.forecast[4].date}</div>
                <img src={src5} alt="" className="weathericon"></img> 
                <div className="dayTemp"> <span>{Math.round(props.forecast[4].temp)}</span>˚</div>

            </div>
        </div>

    </div>
    );

}
